import './App.css';
import React from 'react';
import { Nav } from 'react-bootstrap';
var FilteredList = require('./FilteredList.js');

const productList = [
  { name: "Cute Plant", size: "Medium"},
  { name: "Happy Plant", size: "Large"},
  { name: "Sad Plant", size: "Desktop"},
  { name: "Smart Plant", size: "Medium"},
  { name: "Sleepy Plant", size: "Desktop"},
  { name: "Crazy Plant", size: "Medium"},
  { name: "Silly Plant", size: "Large"},
  { name: "Funky Plant", size: "Desktop"},
  { name: "Green Plant", size: "Medium"},
  { name: "Rainbow Plant", size: "Medium"},
  { name: "Old Plant", size: "Large"},
  { name: "Baby Plant", size: "Desktop"}
]

var App = React.creatClass({
  render: function() {
    return (
    <div className="App">
      <header className="App-header">
      <Nav.Item><Nav.Link eventKey="All" onSelect={this.onSelectFilterSize}>All</Nav.Link></Nav.Item>
        {/* <DisplayList 
        list={productList}>
        </DisplayList> */}
      </header>
    </div>
    );
  }
})

module.export = App;
